import React from 'react';
import NewsList from './NewsList';
import Footer from './Footer'; 

const App = () => {
  return (
    <div>
      <h1>News App</h1>
      <NewsList endpoint="/search?query=technology" title="Tech News" />
      <NewsList endpoint="/category/science" title="Science News" />
      <NewsList endpoint="/category/politics" title="Politics News" />
      <NewsList endpoint="/category/international" title="International News" />
      <NewsList endpoint="/category/business" title="Business News" />
      <NewsList endpoint="/category/entertainment" title="Entertainment News" />
      <Footer />
    </div>
  );
};

export default App;
